import React from 'react';
import Button from '../../components/Button';
import './style.css';


function HomePage(){
    return (
        <div
        style={{
            display:'flex',
            justifyContent:'center',
            flexDirection:'column'
        }}>
            <Button
                text="Password Strength Checker"
                fontSize="30px"
                fontWeight="bold"
            ></Button>
            <p s>
                With Secure Password, it's easy to check your password strength and get feedback on your phone, computer, tablet, and more.<br></br>
                You can also discover how long it takes for a computer to crack your password and how to improve it and make it harder to crack.
            </p>
        </div>
    )
}

export default HomePage;
